import React, { Component } from "react";
import { Form, Segment, Container, Button, Input } from "semantic-ui-react";

class App extends Component {
  //WARNING! To be deprecated in React v17. Use componentDidMount instead.
  constructor(props) {
    super(props);
    this.state = {
      response: []
    };

    this.applysearch = () => {
      let URL = document.getElementById("repo-url").value;
      if (URL) {
        fetch(URL, {
          Method: "GET"
        })
          .then(data => {
            return data.json();
          })
          .then(response => {
            console.log("data is::" + JSON.stringify(response));
            this.setState({
              response
            });
          });
      }
    };
  }

  componentWillMount() {}

  render() {
    return (
      <div className="root">
        <Segment>
          <Form>
            <Form.Field required>
              <Input id="repo-url" placeholder="Repository URL" />
            </Form.Field>
            <Button type="submit" onClick={this.applysearch}>
              Submit
            </Button>
          </Form>
          <div>{JSON.stringify(this.state.response)}</div>
        </Segment>
      </div>
    );
  }
}

export default App;
